import React, { Component } from "react";
import { SketchPicker } from "react-color";

class ProjectItem extends Component {
  state = { background: "#fff" };
  render() {
    return (
      <>
        <sketchPicker color={this.state.background} />
        <h1>Project Item</h1>
      </>
    );
  }
}
export default ProjectItem;
